import { Fragment } from 'react';
import './App.css';
import Home from './components/layout/Home';

const App = () => {
  return (
    <Fragment>
      <div className='container' style={{ background: '#333' }}>
        <Home />
      </div>
    </Fragment>
  );
};

export default App;
